exports.load = function(page) {
	page.setTitle("Convergence Functions");
	page.leftCol.style.width = page.rightCol.style.width = "25%";
	var cols = [page.leftCol, page.rightCol, page.addCol(page.layoutContent.domItem, "25%"), page.addCol(page.layoutContent.domItem, "25%")];
	var $binds = Object.keys(_$functions);
	var colIndex = 0;
	var $links = {};
	for (var ii = 0, jj = $binds.length; ii < jj; ii++) {
		var $bind = $binds[ii];
		var id = page.id + "-function-" + $bind;
		$links[id] = {
			$title: _$functions[$bind],
			$url: "/trans/x3/erp/superv/$sessions?f={0}%2F2%2F%2FM".replace("{0}", $bind)
		};
		page.loadNewItem(cols[colIndex], {
			$category: "link",
			$skin: "s-uitest-mn",
			$bind: id
		});
		colIndex++;
		if (colIndex == 4) {
			colIndex = 0;
		}
	}
	page.applyChange({
		$links: $links
	});
};